In GraphicalViewer the function "public EditPart findObjectAtExcluding(Point pt, Collection exclude,final Conditional condition)" contains a bug:
When a figure is selected with the selectionTool, a MoveHandle is created which sorrounds the selectedFigure. When the mouse is on top of the MoveHandle the funciton findObjectAtExcluding(Point pt, Collection exclude,final Conditional condition) returns the rootEditPart instead of the figure wich contains the MoveHandle.
This is because this funciton uses IFigure figure = getLightweightSystem().getRootFigure().findFigureAt(pt.x, pt.y, new ConditionalTreeSearch(exclude)); to find the figure and then finds the editPart.
I have solved this problem by adding the following code:
if (figure instanceof MyMoveHandle) {
   IFigure searchFigure = ((MyMoveHandle) figure).getOwner().getFigure();
   figure = searchFigure.findFigureAt(pt.x - 1, pt.y - 1);
}
Where MyMoveHandle is an extendion of MoveHandle with the method getOwner setted to public.

Paul,

Resolving an issue promptly and adding myself to the CC list, should there be need for further discussion, ought not to be a cause of concern for you.  In hindsight you can see that your orignal problem report was not clearly asking (to my reading) for the ability to reference a workspace Ecore resource via a platform:/plugin URI verses the expected platform:/resource URI. In fact, the problem summary statement could well be interpretted as saying that if a resource happens to be a registered resource, then it cannot be opened in the workspace, which is not actually the case. Furthermore, the original problem as described could well have been solved by producing a platform:/resource URI as the result of a Load Registered Packages (for packages only in the workspace), and that would have resulted in you reopening the bugzilla because you still didn't have want you wanted. It's important to clearly state all the salient aspects of what you were expecting.

Note that I tend to respond to user input better when it's raised as a discussion in the newsgroup or when it's associated with a carefully described feature request, and that I respond less favourably when it it takes the form of a problem report that is easily misinterpetted as a user misunderstanding.  In any event, let's put the concerns and consternation aside and focus on your last comment, i.e., the assurance you want that things will work well as it stands today.

Consider if all resource URIs were of the form platform:/resource/<project>/<path>, then all serialized references would be relative of the form ../<more../<project>/<path>.  Similarly, if all resource URIs were of the form platform:/plugin/<plugin-id>/<path>, then all serialized references would be relative of the form ../<more..>/<plugin-id>/<path>.  So if the <project> and the <plugin-id> are the same, the same relative references and hence the same serialized artifacts will work properly in either case.  Using the same artifacts avoids needing to swizzle references when building a runtime image, so that was our goal.

Now suppose that from your workspace you want to reference an Ecore model in the target environment as platform:/plugin/<plugin-A>/<path>.  So that works nicely too, but what happens if plugin A is subsequently imported into the workspace?  Even though we are referencing platform:/plugin/<plugin-A>, we want it to resolve to the version in the workspace, which might contain local changes. To handle that, the Ecore editor does the following during initialization:

      editingDomain.getResourceSet().getURIConverter().getURIMap().putAll
        (EcorePlugin.computePlatformURIMap());

That utility method is implemented like this:

  public static Map computePlatformURIMap()
  {
    Map result = new HashMap();
    result.putAll(computePlatformPluginToPlatformResourceMap());
    result.putAll(computePlatformResourceToPlatformPluginMap
      (new HashSet
         (EcorePlugin.getEPackageNsURIToGenModelLocationMap().values())));
    return result;
  }

The method computePlatformPluginToPlatformResourceMap computes a full map for all the plugins in the workspace to map the plugin location to the workspace location, i.e., a map from platform:/plugin/<plugin-ID>/ to platform:/resource/<project>/ for each plugin project.  This map ensures that when <plugin-A> is available the workspace, platform:/plugin references to it will resolve into the workspace instance instead of to the target environment instance.

Now suppose that you've imported into the workspace a plugin that has a relative reference to another Ecore model, but since that reference is relative and since the plugin has been imported into the workspace where the containing file is opened with a platform:/resource URI, the reference also resolves to a platform:/resource URI of the form platform:/resource/<plugin-A>/<path> where <plugin-A> might well not actually be in the workspace.  The second part of the above utility method helps here because it computes a map from platform:/resource/<plugin-ID>/ to platform:/plugin/<plugin-ID>/ for all plugins that contain registered Ecore models. As such, these projects will appear, for the purpose of resolving proxies, as projects in the workspace.

So you can see that we've tried to cover all the bases (since we rely on this ourselves) and that we really do intended that models available in the workspace should be used directly via their platform:/resource URI and that only for models available only in the target environment should there be a need to open them via the registered packages browse action. I.e., that action was introduced purely to avoid needing to import projects into the workspace only for the purpose of extending the models provided by that project.

I don't think any additional changes are needed nor do I think is it desireable to use a platform:/plugin URI when a platform:/resource URI is available...

