The PDE validator reports incorrect errors for schemas with content similar to:

<element name="foo">
    <complexType>
        <sequence>
            <element ref="element-ref"/>
            <element name="element-local">
               ...
            </element>
        </sequence>
    </complexType>
</element>

It correctly validates "element-ref" children of "foo", but for "element-local" children it reports the error:
    Element 'element-local' is not legal as a child of element 'foo'.


The cause of this is in class org.eclipse.pde.internal.core.builders.ExtensionsErrorReporter, method computeAllowedElements(ISchemaCompositor).

private void computeAllowedElements(ISchemaCompositor compositor, HashSet elementSet) {
    ISchemaObject[] children = compositor.getChildren();
    for (int i = 0; i < children.length; i++) {
        ISchemaObject child = children[i];
        if (child instanceof ISchemaObjectReference) {
            ISchemaObjectReference ref = (ISchemaObjectReference) child;
            ISchemaElement refElement = (ISchemaElement) ref.getReferencedObject();
            if (refElement != null)
                elementSet.add(refElement.getName());
        } else if (child instanceof ISchemaCompositor) {
            computeAllowedElements((ISchemaCompositor) child, elementSet);
        }
    }
}

It only checks whether the child of the element is a ISchemaObjectReference or a ISchemaCompositor.  It doesn't add the name of the element if it is a ISchemaElement.

