I am launching a rather big commercial Eclipse application. For its startup, about 13.5% is spent inside BundleLoader.initialize(), with one call using almost 10% of the entire startup. The culprit is an O(n2) algorithm whose apparent purpose is to remove duplicates from an export list:

   // init the provided packages set
   ExportPackageDescription[] exports = description.getSelectedExports();
   ...
      exportedPackages = new ArrayList(exports.length);
      for (int i = 0; i < exports.length; i++) {
         if (!exportedPackages.contains(exports[i].getName())) {  <-- expensive
            exportedPackages.add(exports[i].getName());
            ...
         }
   }

Note the use of ArrayList, instead of a HashSet, which would be more scalable. 
For my product, using an ArrayList results in 4 million method calls.
This is 1/6th of the entire startup of my product.

I recommend 160s/ArrayList/HashSet/, similar to the loop before this one in the very same method. By using a HashSet, I expect this method to be faster also:

   final boolean isExportedPackage(String name) {
      return exportedPackages == null ? false : exportedPackages.contains(name);
   }

