import org.eclipse.swt.widgets.Display;
import org.eclipse.swt.widgets.Event;
import org.eclipse.swt.widgets.Listener;
import org.eclipse.swt.widgets.Shell;

public class DoubleBufferBug {

	public static void main(String args[]) {
		Display display = new Display();
		final Shell shell = new Shell(display, SWT.DIALOG_TRIM|SWT.RESIZE|SWT.DOUBLE_BUFFERED);
		shell.setLayout(null);

		shell.addControlListener(new ControlListener() {
			public void controlMoved(ControlEvent e) {
			}
			public void controlResized(ControlEvent e) {
				// create the background image
				Image offscreenImage = new Image(null, shell.getSize().x, shell.getSize().y);
				GC gc = new GC(offscreenImage);
				gc.setBackground(shell.getDisplay().getSystemColor(SWT.COLOR_BLUE));
				gc.setForeground(shell.getDisplay().getSystemColor(SWT.COLOR_YELLOW));
				gc.fillGradientRectangle(0, 0, shell.getSize().x, shell.getSize().y, true);

				Image existingImage = shell.getBackgroundImage();
				if (existingImage != null)
					existingImage.dispose();

				shell.setBackgroundImage(offscreenImage);
				gc.dispose();
			}
		});

		// NOTE: if listener is added, painting 
		// of the background is wrong
		Listener listener = new Listener() {
			public void handleEvent(Event e) {
				// NOTE: uncomment the following to 
				// workaround the bug
				if (e.x != 0 || e.y != 0)
					shell.redraw(0, 0, shell.getSize().x, shell.getSize().y, true);
			}
		};

		shell.addListener(SWT.Paint, listener);
		shell.pack();
		shell.open();
		while (!shell.isDisposed()) {
			if (!display.readAndDispatch())
				display.sleep();
		}
		display.dispose();
	}	

}

When starting my product, OSGi.launch eventually results in StateReader.readState which needs 1.2 million method calls in total to read the state.

The readState method makes 12,952 calls to BundleDescriptionImpl.addDependent(...). 
That one results in the 12,952 calls to ArrayList.contains, which nested uses ~600,000 method call (about 4% of the entire startup cost).

There must be a faster way to avoid multiple occurrences of dependents?
Here is the offending code:

	protected synchronized void addDependent(BundleDescription dependent) {
		if (dependents == null)
			dependents = new ArrayList(10);
		if (!dependents.contains(dependent))
			dependents.add(dependent);
	}

Do we really have to check for multiples? It makes state reading twice as slow.
I would imagine we could check when we are writing the state and not generate duplicates then?
